import React from 'react';
import './styles/ProfileContainer.css';
import wizardImage from '../assets/images/wizard.jpg';
import { getPlayerData } from '../utils/api';

let player
const ProfileContainer = () => {
    return (
        <div className="profile-container">
            <div className="profile-header">
                <img src={wizardImage} alt="Profile" className="profile-picture" />
            </div>
            <div className="profile-details">
            <h2 className="profile-name"><span id="player-name">God</span></h2>
            <p><strong>Location:</strong> <span id="location">New York, USA</span></p>
            <p><strong>Team:</strong> <span id="location">La Chiesa</span></p>
            <p><strong>Highest Score:</strong> <span id="highest-score">85,000</span></p>
            <p><strong>Home Arcade:</strong> <span id="home-arcade">Lowry Parcade</span></p>
            <p><strong>Social Media Links:</strong> <span id="social-media-links">[Twitter, Instagram, etc.]</span></p>
            <p><strong>Stream Links:</strong> <span id="stream-links">[Twitch, YouTube]</span></p>
            </div>
        </div>
    );
};

export default ProfileContainer;
